import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply Price Sort Filter
    await page.waitForSelector('select.search-category'); // Wait for the category selector
    await page.selectOption('select.search-category', 'Electronics'); // Select Electronics category

    await page.waitForSelector('select.sort-controls'); // Wait for the sort controls
    await page.selectOption('select.sort-controls', 'price-low'); // Sort by price low to high

    // Take screenshot after applying filters
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sort_applied.png'));

    // Verify the sorting by checking the first product price
    const firstProductPrice = await page.$eval('.product-card .product-price', el => el.innerText);

    return {
      success: true,
      action: "Applied price sort filter and verified the first product price",
      extractedData: { firstProductPrice },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
